content:
Use the public Einstein Discovery API to fetch Decision Optimization results.

The API can reference:

* The Optimization Definition Id, which you can copy from the URL when editing the Optimization Definition in Analytics Studio.
* The Optimization Job IdoptimizationJobId, which refers to a particular run of the Optimization Definition. If no job is specified, the result uses the last successful optimization run.

You can fetch the job ID through a GET call that references the Optimization Definition, for example, fetch optimization results for a single record.

GET
/services/data/v57.0/smartdatadiscovery/optimizationdefinitions/1OVB0000000CaRM/jobs

POST
/services/data/v57.0/smartdatadiscovery/optimization-results

REQUEST BODY
{
 "optimizationDefinitionId": "1OVB0000000CaRMOA0",
 "optimizationJobId": "1OYB0000000CaRWOA0",
 "targets": [
   {
     "id": "a4qB0000000Pv3SIAS"
   }
 ]
}

This example generates this response.

{
 "optimizationDefinition" : {
   "id" : "1OVB0000000CaRMOA0"
 },
 "optimizationJob" : {
   "id" : "1OYB0000000CaRWOA0"
 },
 "results" : [ {
   "decisions" : [ {
     "fieldName" : "Service__c",
     "fieldType" : "Text",
     "fieldValue" : "Fleet Management"
   }, {
     "fieldName" : "Driver_Development__c",
     "fieldType" : "Text",
     "fieldValue" : "TRUE"
   }, {
     "fieldName" : "ObjectiveValue",
     "fieldType" : "Number",
     "fieldValue" : "5.59653193263519E7"
   } ],
   "target" : {
     "id" : "a4qB0000000Pv3SIAS"
   }
 } ]
}

